package com.zongcc.staticTest;

import org.apache.commons.codec.binary.Base64;

import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;
import java.io.UnsupportedEncodingException;

public class Base64Test {
    public static void main(String[] args) throws IOException {
        final Base64 base64 = new Base64();
        final String text = "字串文字";
        final byte[] textByte = text.getBytes("UTF-8");
        //編碼
        final String encodedText = base64.encodeToString(textByte);
        System.out.println(encodedText);
        //解碼
        String encodedText2="/9j/4AAQSkZJRgABAQEASABIAAD" +
                "";
       // System.out.println(new String(base64.decode(encodedText2), "UTF-8"));
        OutputStream out = new FileOutputStream("D:\\a.jpeg");
        out.write(encodedText2.getBytes());
        out.flush();
        out.close();
    }
}